import (
	context "context"
	rapiddocs "github.com/pagination/rapiddocs"
	rapiddocsclient "github.com/pagination/rapiddocs/client"
	option "github.com/pagination/rapiddocs/option"
)

client := rapiddocsclient.NewClient(
	option.WithToken(
		"<YOUR_AUTH_TOKEN>",
	),
)
response, err := client.Complex.Search(
	context.TODO(),
	&rapiddocs.SearchRequest{
		Pagination: &rapiddocs.StartingAfterPaging{
			PerPage: 1,
			StartingAfter: rapiddocs.String(
				"starting_after",
			),
		},
		Query: rapiddocs.NewSearchRequestQueryFromSingleFilterSearchRequest(
			&rapiddocs.SingleFilterSearchRequest{
				Field: rapiddocs.String(
					"field",
				),
				Operator: rapiddocs.SingleFilterSearchRequestOperatorEquals,
				Value: rapiddocs.String(
					"value",
				),
			},
		),
	},
)

